import React from 'react';
import Input from './Input'
import './Panel.css';
import MovesHistory from './MovesHistory';

class Panel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <aside id="Panel">
                <Input />
                <MovesHistory />
            </aside>
        );
    }
}

export default Panel;
